uccessful delivery.</div><div>9. MBM Authority has the right to cancel purchase order or any part of it, if the supplier fails to abide by the terms and conditions of the purchase order at any time or if the situation demands so.</div><div><br></div>', 'yes', 'Active', 0, 1),
